    public static void main(String[] args){
        int first = map.indexOf("KAF");
        String flag = "";
        int fiboIndex = 0;
        while (!flag.contains("}")){
            flag+=map.charAt(fiboObject(2+fiboIndex)+first-1);
            fiboIndex++;
            System.out.println(flag);
        }
    }

    private static int fiboObject(int fiboIndex) {
        if (fiboIndex == 0)
            return 0;
        if (fiboIndex == 1)
            return 1;
        return fiboObject(fiboIndex - 2) + fiboObject(fiboIndex - 1);
    }
